import React from "react";
import ListComp from "./project4/ListComp";
import { Route, Routes } from "react-router-dom";

function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<ListComp />} />
      </Routes>
    </>
  );
}

export default App;
